import React, {Fragment} from "react"

const FileUpload = ()=>{
     return <Fragment>
           <form>
               <input type="file" id="fileInput"></input>
               <label htmlFor="fileInput">Choose file</label>
           </form>
     </Fragment>
}

export default FileUpload;
